// Projects.js

import React from 'react';
import '../App.css';
import LeftSideProfile from './LeftSideProfile';

// 1~10번 이미지 (예: ./pjts/1.png ~ 10.png)
import p1 from './pjts/1.png';
import p2 from './pjts/2.png';
import p3 from './pjts/3.png';
import p4 from './pjts/4.png';
import p5 from './pjts/5.png';
import p6 from './pjts/6.png';
import p7 from './pjts/7.png';
import p8 from './pjts/8.png';
import p9 from './pjts/9.png';
import p10 from './pjts/10.png';

function Projects() {
  return (
    <div style={{ display: 'flex', width: '100%' }}>

      {/* 왼쪽 프로필 영역 */}
      <LeftSideProfile />

      {/* 중앙: 텍스트와 이미지가 들어가는 메인 영역 */}
      <div style={{ flex: 2, position: 'relative', overflow: 'visible' }}>
        <h2>Projects</h2>
        <hr style={{ borderColor: '#e0e0e0', opacity: '0.15' }} />

        <div className="timeline" style={{ position: 'relative' }}>

          {/* ===== Project 1 ===== */}
          <div 
            className="timeline-item"
            style={{
              marginBottom: '2rem',
              position: 'relative', // 절대 배치의 기준
              minHeight: '220px'    // 이미지 높이보다 약간 큰 값(필요시 조정)
            }}
          >
            {/* 왼쪽 텍스트 (상대 배치) */}
            <div style={{ marginRight: '1rem' }}>
              <h3>Unsupervised Diffusion Model for Synthesizing T1-weighted MRI Scans from Abdominal CT Scans</h3>
              <p style={{ margin: '0 0 0.5rem', fontStyle: 'italic', color: '#555' }}>
                [Project Duration: Jan. 2024 - June. 2024]
              </p>
              <p><strong>Research Assistant</strong></p>
              <p>
                (여기에 긴 설명을 넣어도 텍스트가 충분히 넓게 보이게 됩니다.)
                MRI, CT 차이, diffusion model 소개 등...
              </p>
              <p>@CNU @KIST @SEOULTECH @BAISLAB</p>
              <p>[Paper] | [Code]</p>
            </div>

            {/* 오른쪽 이미지 (절대 배치) */}
            <div 
              style={{
                position: 'absolute',
                top: '0',     // 텍스트 상단에 맞춤
                right: '-220px', // 오른쪽 공간 침범 (flex:1 영역)
                width: '200px',  // 원하는 가로 크기
                textAlign: 'center'
              }}
            >
              <img
                src={p1}
                alt="Project 1"
                style={{
                  width: '200px',
                  height: '150px',
                  objectFit: 'contain'
                }}
              />
            </div>
          </div>

          {/* ===== Project 2 ===== */}
          <div 
            className="timeline-item"
            style={{
              marginBottom: '2rem',
              position: 'relative',
              minHeight: '220px'
            }}
          >
            <div style={{ marginRight: '1rem' }}>
              <h3>GABNet: Graph Attention Boosting Network for circRNA Analysis...</h3>
              <p style={{ margin: '0 0 0.5rem', fontStyle: 'italic', color: '#555' }}>
                [Project Duration: Mar. 2024 - Dec. 2024]
              </p>
              <p><strong>Senior</strong></p>
              <p>
                (긴 설명) ...
              </p>
              <p>[Paper] | [Code]</p>
            </div>
            <div 
              style={{
                position: 'absolute',
                top: '0',
                right: '-220px',
                width: '200px'
              }}
            >
              <img
                src={p2}
                alt="Project 2"
                style={{
                  width: '200px',
                  height: '150px',
                  objectFit: 'contain'
                }}
              />
            </div>
          </div>

          {/* ...이하 Project 3 ~ Project 10 동일 구조 반복... */}

          <div 
            className="timeline-item"
            style={{
              marginBottom: '2rem',
              position: 'relative',
              minHeight: '220px'
            }}
          >
            <div style={{ marginRight: '1rem' }}>
              <h3>Investigating Brainwave Patterns in Response to the "Jumping" Phenomenon</h3>
              <p style={{ margin: '0 0 0.5rem', fontStyle: 'italic', color: '#555' }}>
                [Project Duration: Apr. 2022 - May 2023]
              </p>
              <p><strong>Research Assistant</strong></p>
              <p> (긴 설명)... </p>
              <p>@BrainXLAB @IBS @UNIST</p>
              <p>@IBS-UNIST Joint Research</p>
              <p>[Code]</p>
            </div>
            <div 
              style={{
                position: 'absolute',
                top: '0',
                right: '-220px',
                width: '200px'
              }}
            >
              <img
                src={p10}
                alt="Project 10"
                style={{
                  width: '200px',
                  height: '150px',
                  objectFit: 'contain'
                }}
              />
            </div>
          </div>

        </div>

        <br />
      </div>

      {/* 오른쪽 비어있는 영역 (flex: 1) 
          => 이미지가 침범해서 보이도록 */}
      <div style={{ flex: '1' }}/>
    </div>
  );
}

export default Projects;
